// 用例测试#include <iostream>#include <vector>using namespace std;#include "DoThreeSumSolution.cpp"// 测试用例 g++ -std=c++11 main.cpp -o DoThreeSumSolutionint main(){    // 测试数据    vector<int> nums = {-1,0,1,2,-1,-4};//    vector<int> nums = {0,1,1};//    vector<int> nums = {0,0,0};    // New Instance    DoThreeSumSolution ts;    vector<vector<int>> ret = ts.threeSum(nums);    std::cout << '[';    for (int i = 0; i < ret.size(); ++i) {        // 遍历每个符合要求的结果        std::cout << '[';        vector<int> sub_vector = ret[i];        for (int k = 0; k < sub_vector.size(); ++k) {            std::cout << sub_vector[k];            if(k != sub_vector.size() - 1) {                std::cout << ",";            }        }        std::cout << ']';        if(i != ret.size() - 1) {            std::cout << ",";        }    }    std::cout << ']' << std::endl;    return 0;}